import Navbar from './navbar';
import './App.css';

function App() {
  return (
    <div className="App" style={{
      backgroundImage: `url("data:image/jpeg;base64,")`,
      backgroundSize: 'cover',
      backgroundRepeat:'no-repeat',
      backgroundPosition: 'center',
      width: '100vw',
      height: '100vh'
    }}>
      <Navbar/>
    </div>
  );
}

export default App;
